package main

import (
	"bytes"
	"compress/gzip"
	"encoding/base64"
	"fmt"
	"github.com/hexvalid/travium-go/model"
	"github.com/vmihailenco/msgpack"
	"io/ioutil"
)

func main() {
	var str = ""

	data, _ := base64.StdEncoding.DecodeString(str)
	rdata := bytes.NewReader(data)
	r, _ := gzip.NewReader(rdata)
	s, _ := ioutil.ReadAll(r)

	type AutoGenerated struct {
		GameWorlds struct {
			Loaded  string             `json:"loaded"`
			Loading bool               `json:"loading"`
			List    []model.GameServer `msgpack:"list"`
		} `msgpack:"gameWorlds"`
	}
	var item AutoGenerated

	err := msgpack.Unmarshal(s, &item)
	if err != nil {
		panic(err)
	}
	fmt.Println(item.GameWorlds.List[1].Name)

	fmt.Println(item.GameWorlds.List[1].StartTime())
}
